import React from "react";
// import Header from "./header";
import Scripts from "./bottomContainer";
import MediaCard from "./Card";
import HeadTag from "./HeadTag";
import Button from '@mui/material/Button';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
// import dataSet from "./dataSet";

function Project() {

    const [allData, setData] = React.useState(null);

    React.useEffect(() => {
      fetch("http://localhost:3001/api", {
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }
      })
        .then((res) => res.json())
        .then((data) => setData(data.docs));
    }, []);

    const fullDiv = {
        "margin": "10%",
    };

    const anchorStyle = {
        "textDecoration": "none"
    };

    return (
        <div>
            <HeadTag Title="Python" />
            <div className="container-fluid">

                <div style={fullDiv} className="row">

                    {allData.map(function(object, i) {

                    <div className="col-lg-4 col-md-6 col-sm-6 themes-img">
                        <MediaCard
                            Title={object.title}
                            Image={object.img_url}
                            Desc={object.desc}
                        />
                    </div>
                    })}
                    <Button> <a style={anchorStyle} href="/themes"> <ArrowBackIcon /> All Themes </a> </Button>

                </div>
            </div>
            <Scripts></Scripts>
        </div>
    )
};

export default Project;
